import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "../pages/Home";
import MapPage from "../pages/MapPage";
import Establishments from "../pages/Establishments";
import NatureCulture from "../pages/NatureCulture";
import RouteDetails from "../pages/RouteDetails"; // import it
import AdminDashboard from "../pages/admindashboard";  // adjust path if needed

<Routes>
  <Route path="/" element={<Home />} />
  <Route path="/map" element={<MapPage />} />
  <Route path="/establishments" element={<Establishments />} />
  <Route path="/nature-culture" element={<NatureCulture />} />
  <Route path="/route-details" element={<RouteDetails />} />  {/* <-- here */}
  <Route path="/admin" element={<AdminDashboard isAdmin={true} />} />
</Routes>


export default function App() {
  return (
    <Router>
      <div className="app">
        <nav className="navbar">
          <div style={{ fontWeight: 800 }}>Majayjay Tourism Circuit</div>
          <Link to="/">Home</Link>
          <Link to="/map">Map</Link>
          <Link to="/establishments">Establishments</Link>
          <Link to="/nature-culture">Nature & Culture</Link>
        </nav>

        <div className="page">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/map" element={<MapPage />} />
            <Route path="/establishments" element={<Establishments />} />
            <Route path="/nature-culture" element={<NatureCulture />} />
            <Route path="/route-details" element={<RouteDetails />} /> {/* Add this line */}
          </Routes>
        </div>
      </div>
    </Router>
  );
}
